class Solution {
    /**
    Filter an input list of strings only for ones that contain given substring
    >>> filter_by_substring(List.of(), "a")
    []
    >>> filter_by_substring(Arrays.asList("abc", "bacd", "cde", "array"), "a")
    ["abc", "bacd", "array"]
     */
    public List<String> filter_by_substring(List<String> strings, String substring) {
        List<String> filteredStrings = new ArrayList<>();

        if (strings.isEmpty()) {
            return filteredStrings;
        }

        for (String str : strings) {
            if (str.contains(substring)) {
                filteredStrings.add(str);
            }
        }

        return filteredStrings;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.filter_by_substring(new ArrayList<>(List.of()), "john").equals(List.of()),
                s.filter_by_substring(new ArrayList<>(Arrays.asList("xxx", "asd", "xxy", "john doe", "xxxAAA", "xxx")), "xxx").equals(Arrays.asList("xxx", "xxxAAA", "xxx")),
                s.filter_by_substring(new ArrayList<>(Arrays.asList("xxx", "asd", "aaaxxy", "john doe", "xxxAAA", "xxx")), "xx").equals(Arrays.asList("xxx", "aaaxxy", "xxxAAA", "xxx")),
