class Solution {
    public List<Integer> rolling_max(List<Integer> numbers) {
        List<Integer> rollingMax = new ArrayList<>();
        int maxSoFar = Integer.MIN_VALUE;

        for (int num : numbers) {
            maxSoFar = Math.max(maxSoFar, num);
            rollingMax.add(maxSoFar);
        }

        return rollingMax;
    }
}

