class Solution {
    public List<String> separate_paren_groups(String paren_string) {
        List<String> result = new ArrayList<>();

        paren_string = paren_string.replaceAll("\\s", ""); // Remove spaces

        int start = 0;
        int open = 0;

        for (int i = 0; i < paren_string.length(); i++) {
            if (paren_string.charAt(i) == '(') {
                if (open == 0) {
                    start = i;
                }
                open++;
            } else if (paren_string.charAt(i) == ')') {
                open--;
                if (open == 0) {
                    result.add(paren_string.substring(start, i + 1));
                }
            }
        }

        return result;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.separate_paren_groups("(()()) ((())) () ((())()())").equals(Arrays.asList(
                        "(()())", "((()))", "()", "((())()())"
                )),
                s.separate_paren_groups("() (()) ((())) (((())))").equals(Arrays.asList(
                        "()", "(())", "((()))", "(((())))"
                )),
                s.separate_paren_groups("(()(())((())))").equals(Arrays.asList(
                        "(()(())((())))"
                )),
                s.separate_paren_groups("( ) (( )) (( )( ))").equals(Arrays.asList("()", "(())", "(()())"))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
