class Solution {
    public List<Integer> parse_music(String string) {
        List<Integer> beats = new ArrayList<>();

        String[] notes = string.split(" ");

        for (String note : notes) {
            int duration = 0;
            switch (note) {
                case "o":
                    duration = 4;
                    break;
                case "o|":
                    duration = 2;
                    break;
                case ".|":
                    duration = 1;
                    break;
            }
            beats.add(duration);
        }

        return beats;
    }
}

