class Solution {
    /**
    For a given number n, find the largest number that divides n evenly, smaller than n
    >>> largest_divisor(15)
    5
     */
    public int largest_divisor(int n) {
        int largestDivisor = 1;

        for (int i = 1; i < n; i++) {
            if (n % i == 0 && i < n) {
                largestDivisor = i;
            }
        }

        return largestDivisor;
    }
}

public class Main {
