class Solution {
    public List<Double> find_closest_elements(List<Double> numbers) {
        List<Double> result = new ArrayList<>();
        if (numbers == null || numbers.size() < 2) {
            return result;
        }

        double minDiff = Double.MAX_VALUE;
        double num1 = 0.0;
        double num2 = 0.0;

        for (int i = 0; i < numbers.size(); i++) {
            for (int j = i + 1; j < numbers.size(); j++) {
                double diff = Math.abs(numbers.get(i) - numbers.get(j));
                if (diff < minDiff) {
                    minDiff = diff;
                    num1 = numbers.get(i);
                    num2 = numbers.get(j);
                }
            }
        }

        result.add(Math.min(num1, num2));
        result.add(Math.max(num1, num2));

        return result;
    }
}

