class Solution {
    /**
    Return the number of times the digit 7 appears in integers less than n which are divisible by 11 or 13.
    >>> fizz_buzz(50)
    0
    >>> fizz_buzz(78)
    2
    >>> fizz_buzz(79)
    3
     */
    public int fizz_buzz(int n) {
        int count = 0;
        for (int i = 1; i < n; i++) {
            if (isDivisibleBy11Or13(i)) {
                count += countDigit7(i);
            }
        }
        return count;
    }

