class Solution {
    public int prime_fib(int n) {
        if (n <= 0) {
            return -1; // Invalid input
        }

        int count = 0;
        int num1 = 0;
        int num2 = 1;

        while (count < n) {
            int sum = num1 + num2;
            num1 = num2;
            num2 = sum;
            count++;

            if (isPrime(sum)) {
                if (count == n) {
                    return sum;
                }
            }
        }

        return -1; // No prime Fibonacci number found
    }

    private boolean isPrime(int num) {
        if (num <= 1) {
            return false;
        }

        for (int i = 2; i <= Math.sqrt(num); i++) {
            if (num % i == 0) {
                return false;
            }
        }

        return true;
    }
}

