                Objects.equals(s.change_base(16, 2), "10000"),
                Objects.equals(s.change_base(8, 2), "1000"),
                Objects.equals(s.change_base(7, 2), "111")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
