class Solution {
    /**
    Checks if given string is a palindrome
    >>> is_palindrome("")
    true
    >>> is_palindrome("aba")
    true
    >>> is_palindrome("aaaaa")
    true
    >>> is_palindrome("zbcd")
    false
     */
    public boolean is_palindrome(String text) {
        if (text.isEmpty()) {
            return true;
        }

        int left = 0;
        int right = text.length() - 1;

        while (left < right) {
            if (text.charAt(left) != text.charAt(right)) {
                return false;
            }
            left++;
            right--;
        }

        return true;
    }
}

