class Solution {
    /**
    Return 2^n modulo p (be aware of numerics).
    >>> modp(3, 5)
    3
    >>> modp(1101, 101)
    2
    >>> modp(0, 101)
    1
    >>> modp(3, 11)
    8
    >>> modp(100, 101)
    1
     */
    public int modp(int n, int p) {
        long result = 1;
        for (int i = 0; i < n; i++) {
            result *= 2;
            if (result >= p) {
                result %= p;
            }
        }
        return (int) result;
    }
}

