class Solution {
    public String circular_shift(int x, int shift) {
        // Calculate the number of digits in the integer x
        int numDigits = String.valueOf(x).length();

        // Calculate the effective shift value by taking the modulus of shift and the number of digits
        int effectiveShift = shift % numDigits;

        // Perform the circular shift operation by shifting the digits of the integer x to the right by the effective shift value
        int shiftedNum = x % (int) Math.pow(10, effectiveShift) * (int) Math.pow(10, numDigits - effectiveShift) + x / (int) Math.pow(10, effectiveShift);

        // Convert the resulting integer back to a string
        String result = String.valueOf(shiftedNum);

        return result;
    }
}

