class Solution {
    public double triangle_area(double a, double b, double c) {
        if (isTriangleValid(a, b, c)) {
            return Math.round(calculateArea(a, b, c) * 100.0) / 100.0;
        } else {
            return -1;
        }
    }

    private boolean isTriangleValid(double a, double b, double c) {
        return a + b > c && a + c > b && b + c > a;
    }

    private double calculateArea(double a, double b, double c) {
        double s = (a + b + c) / 2;
        return Math.sqrt(s * (s - a) * (s - b) * (s - c));
    }
}

