class Solution {
    public List<Integer> pluck(List<Integer> arr) {
        List<Integer> evenValues = new ArrayList<>();

        for (int i = 0; i < arr.size(); i++) {
            if (arr.get(i) % 2 == 0) {
                evenValues.add(arr.get(i));
            }
        }

        if (evenValues.isEmpty()) {
            return new ArrayList<>();
        }

        int smallestEven = evenValues.get(0);
        int smallestIndex = arr.indexOf(smallestEven);

        for (int i = 1; i < evenValues.size(); i++) {
            if (evenValues.get(i) < smallestEven) {
                smallestEven = evenValues.get(i);
                smallestIndex = arr.indexOf(smallestEven);
            }
        }

        return Arrays.asList(smallestEven, smallestIndex);
    }
}

public class Main {
