class Solution {
    public boolean is_multiply_prime(int a) {
        if (a >= 100) {
            return false;
        }

        List<Integer> primes = findPrimes();

        for (int i = 0; i < primes.size(); i++) {
            for (int j = i + 1; j < primes.size(); j++) {
                for (int k = j + 1; k < primes.size(); k++) {
                    if (primes.get(i) * primes.get(j) * primes.get(k) == a) {
                        return true;
                    }
                }
            }
        }

        return false;
    }

    private List<Integer> findPrimes() {
        List<Integer> primes = new ArrayList<>();

        for (int i = 2; i < 100; i++) {
            if (isPrime(i)) {
                primes.add(i);
            }
        }

        return primes;
    }

    private boolean isPrime(int num) {
        if (num < 2) {
            return false;
        }

        for (int i = 2; i <= Math.sqrt(num); i++) {
            if (num % i == 0) {
                return false;
            }
        }

        return true;
    }
}

