class Solution {
    public boolean will_it_fly(List<Integer> q, int w) {
        if (!isPalindromic(q)) {
            return false;
        }

        int sum = calculateSum(q);

        return sum <= w;
    }

    private boolean isPalindromic(List<Integer> q) {
        int start = 0;
        int end = q.size() - 1;

        while (start < end) {
            if (!q.get(start).equals(q.get(end))) {
                return false;
            }
            start++;
            end--;
        }

        return true;
    }

    private int calculateSum(List<Integer> q) {
        int sum = 0;

        for (int num : q) {
            sum += num;
        }

        return sum;
    }
}

