class Solution {
    public int hex_key(String num) {
        // Create a map to store the decimal values of hexadecimal digits
        Map<Character, Integer> hexMap = new HashMap<>();
        hexMap.put('0', 0);
        hexMap.put('1', 1);
        hexMap.put('2', 2);
        hexMap.put('3', 3);
        hexMap.put('4', 4);
        hexMap.put('5', 5);
        hexMap.put('6', 6);
        hexMap.put('7', 7);
        hexMap.put('8', 8);
        hexMap.put('9', 9);
        hexMap.put('A', 10);
        hexMap.put('B', 11);
        hexMap.put('C', 12);
        hexMap.put('D', 13);
        hexMap.put('E', 14);
        hexMap.put('F', 15);

        // Initialize a counter for prime digits
        int primeCount = 0;

        // Convert hexadecimal number string to decimal number
        int decimalNum = 0;
        for (int i = 0; i < num.length(); i++) {
            char c = num.charAt(i);
            decimalNum = decimalNum * 16 + hexMap.get(c);
        }

        // Check if each digit of the decimal number is a prime number
        while (decimalNum > 0) {
            int digit = decimalNum % 10;
            if (digit == 2 || digit == 3 || digit == 5 || digit == 7 || digit == 11 || digit == 13) {
                primeCount++;
            }
            decimalNum /= 10;
        }

        return primeCount;
    }
}

