                s.hex_key("ABED1A33") == 4,
                s.hex_key("2020") == 2,
                s.hex_key("123456789ABCDEF0") == 6,
                s.hex_key("112233445566778899AABBCCDDEEFF00") == 12,
                s.hex_key("") == 0
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

