class Solution {
    public boolean is_happy(String s) {
        if (s.length() < 3) {
            return false;
        }

        for (int i = 0; i <= s.length() - 3; i++) {
            HashSet<Character> set = new HashSet<>();
            for (int j = i; j < i + 3; j++) {
                if (set.contains(s.charAt(j))) {
                    return false;
                }
                set.add(s.charAt(j));
            }
        }

        return true;
    }
}

