class Solution {
    /**
    Given a positive integer n, return the count of the numbers of n-digit
    positive integers that start or end with 1.
     */
    public int starts_one_ends(int n) {
        int total = 9 * (int) Math.pow(10, n - 1);
        int startWithOne = (int) Math.pow(10, n - 1);
        int endWithOne = (int) Math.pow(10, n - 1);

        return startWithOne + endWithOne - total;
    }
}

