class Solution {
    /**
    You are given a list of integers.
    Write a function next_smallest() that returns the 2nd smallest element of the list.
    Return null if there is no such element.
    <p>
    next_smallest(Arrays.asList(1, 2, 3, 4, 5)) == Optional[2]
    next_smallest(Arrays.asList(5, 1, 4, 3, 2)) == Optional[2]
    next_smallest(Arrays.asList()) == Optional.empty
