class Solution {
    public List<List<Integer>> get_row(List<List<Integer>> lst, int x) {
        List<List<Integer>> coordinates = new ArrayList<>();

        for (int i = 0; i < lst.size(); i++) {
            List<Integer> row = lst.get(i);
            for (int j = 0; j < row.size(); j++) {
                if (row.get(j) == x) {
                    List<Integer> coordinate = new ArrayList<>();
                    coordinate.add(i);
                    coordinate.add(j);
                    coordinates.add(coordinate);
                }
            }
        }

        coordinates.sort((a, b) -> a.get(0) - b.get(0));

        for (List<Integer> row : coordinates) {
            row.sort((a, b) -> b - a);
        }

        return coordinates;
    }
}

