class Solution {
    public String encode(String message) {
        char[] encodedMessage = new char[message.length()];
        for (int i = 0; i < message.length(); i++) {
            char currentChar = message.charAt(i);
            if (Character.isLetter(currentChar)) {
                if (Character.toLowerCase(currentChar) == 'a' || Character.toLowerCase(currentChar) == 'e' ||
                        Character.toLowerCase(currentChar) == 'i' || Character.toLowerCase(currentChar) == 'o' ||
                        Character.toLowerCase(currentChar) == 'u') {
                    char newChar = (char) (currentChar + 2);
                    if (Character.isUpperCase(currentChar)) {
                        newChar = Character.toUpperCase(newChar);
                    }
                    encodedMessage[i] = newChar;
                } else {
                    if (Character.isUpperCase(currentChar)) {
                        encodedMessage[i] = Character.toLowerCase(currentChar);
                    } else {
                        encodedMessage[i] = Character.toUpperCase(currentChar);
                    }
                }
            } else {
                encodedMessage[i] = currentChar;
            }
        }
        return new String(encodedMessage);
    }
}

