class Solution {
    public int sumOfDigitsOfLargestPrime(List<Integer> lst) {
        List<Integer> primeNumbers = new ArrayList<>();

        for (int num : lst) {
            if (isPrime(num)) {
                primeNumbers.add(num);
            }
        }

        if (primeNumbers.isEmpty()) {
            return 0;
        }

        int largestPrime = primeNumbers.stream().max(Integer::compare).get();
        int sumOfDigits = 0;

        while (largestPrime != 0) {
            sumOfDigits += largestPrime % 10;
            largestPrime /= 10;
        }

        return sumOfDigits;
    }

    private boolean isPrime(int num) {
        if (num <= 1) {
            return false;
        }

        for (int i = 2; i <= Math.sqrt(num); i++) {
            if (num % i == 0) {
                return false;
            }
        }

        return true;
    }
}

