class Solution {
    public int closest_integer(String value) {
        double parsedValue = Double.parseDouble(value);
        int ceiling = (int) Math.ceil(parsedValue);
        int floor = (int) Math.floor(parsedValue);

        double diffCeiling = Math.abs(parsedValue - ceiling);
        double diffFloor = Math.abs(parsedValue - floor);

        if (diffCeiling < diffFloor) {
            return ceiling;
        } else if (diffFloor < diffCeiling) {
            return floor;
        } else {
            if (parsedValue >= 0) {
                return ceiling;
            } else {
                return floor;
            }
        }
    }
}

