class Solution {
    public int count_nums(List<Integer> arr) {
        int count = 0;

        for (int num : arr) {
            int sum = 0;
            int temp = Math.abs(num);

            while (temp != 0) {
                sum += temp % 10;
                temp /= 10;
            }

            if (sum > 0) {
                count++;
            }
        }

        return count;
    }
}

