class Solution {
    public List<Integer> unique_digits(List<Integer> x) {
        List<Integer> result = new ArrayList<>();

        for (int num : x) {
            if (hasNoEvenDigits(num)) {
                result.add(num);
            }
        }

        Collections.sort(result);

        return result;
    }

    private boolean hasNoEvenDigits(int num) {
        while (num > 0) {
            int digit = num % 10;
            if (digit % 2 == 0) {
                return false;
            }
            num /= 10;
        }
        return true;
    }
}

