class Solution {
    public String exchange(List<Integer> lst1, List<Integer> lst2) {
        if (allEven(lst1)) {
            return "YES";
        }

        for (int i = 0; i < lst1.size(); i++) {
            if (lst1.get(i) % 2 != 0) {
                for (int j = 0; j < lst2.size(); j++) {
                    if (lst2.get(j) % 2 == 0) {
                        lst1.set(i, lst2.get(j));
                        lst2.set(j, lst1.get(i));
                        break;
                    }
                }
            }
        }

        if (allEven(lst1)) {
            return "YES";
        }

        return "NO";
    }

    private boolean allEven(List<Integer> lst) {
        for (int num : lst) {
            if (num % 2 != 0) {
                return false;
            }
        }
        return true;
    }
}

public class Main {
