class Solution {
    public String get_closest_vowel(String word) {
        List<Character> vowels = Arrays.asList('a', 'e', 'i', 'o', 'u', 'A', 'E', 'I', 'O', 'U');
        List<Integer> consonantIndices = new ArrayList<>();

        for (int i = 0; i < word.length(); i++) {
            if (!vowels.contains(word.charAt(i))) {
                consonantIndices.add(i);
            }
        }

        for (int j = consonantIndices.size() - 1; j >= 1; j--) {
            int start = consonantIndices.get(j);
            int end = consonantIndices.get(j - 1);

            for (int k = start - 1; k > end; k--) {
                if (vowels.contains(word.charAt(k))) {
                    return String.valueOf(word.charAt(k));
                }
            }
        }

        return "";
    }
}

