class Solution {
    public String match_parens(List<String> lst) {
        String str1 = lst.get(0);
        String str2 = lst.get(1);

        if (!checkEqualParentheses(str1, str2)) {
            return "No";
        }

        if (checkBalancedParentheses(str1 + str2) || checkBalancedParentheses(str2 + str1)) {
            return "Yes";
        }

        return "No";
    }

    private boolean checkEqualParentheses(String str1, String str2) {
        return countParentheses(str1, '(') == countParentheses(str2, '(') && countParentheses(str1, ')') == countParentheses(str2, ')');
    }

    private int countParentheses(String str, char paren) {
        int count = 0;
        for (char c : str.toCharArray()) {
            if (c == paren) {
                count++;
            }
        }
        return count;
    }

    private boolean checkBalancedParentheses(String str) {
        Stack<Character> stack = new Stack<>();
        for (char c : str.toCharArray()) {
            if (c == '(') {
                stack.push(c);
            } else if (c == ')') {
                if (stack.isEmpty()) {
                    return false;
                }
                stack.pop();
            }
        }
        return stack.isEmpty();
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.match_parens(Arrays.asList("()(", ")")).equals("Yes"),
                s.match_parens(Arrays.asList(")", ")")).equals("No"),
                s.match_parens(Arrays.asList("(()(())", "())())")).equals("No"),
                s.match_parens(Arrays.asList(")())", "(()()(")).equals("Yes"),
                s.match_parens(Arrays.asList("(())))", "(()())((")).equals("Yes"),
                s.match_parens(Arrays.asList("()", "())")).equals("No"),
                s.match_parens(Arrays.asList("(()(", "()))()")).equals("Yes"),
                s.match_parens(Arrays.asList("((((", "((())")).equals("No"),
                s.match_parens(Arrays.asList(")(()", "(()(")).equals("No"),
                s.match_parens(Arrays.asList(")(", ")(")).equals("No")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

