class Solution {
    public boolean is_sorted(List<Integer> lst) {
        if (lst.size() <= 1) {
            return true;
        }

        for (int i = 1; i < lst.size(); i++) {
            if (lst.get(i) < lst.get(i - 1)) {
                return false;
            }
        }

        Map<Integer, Integer> countMap = new HashMap<>();
        for (int num : lst) {
            countMap.put(num, countMap.getOrDefault(num, 0) + 1);
            if (countMap.get(num) > 2) {
                return false;
            }
        }

        return true;
    }
}

