class Solution {
    public Optional<Integer> prod_signs(List<Integer> arr) {
        if (arr.isEmpty()) {
            return Optional.empty();
        }

        int productOfSigns = 1;
        int sumOfMagnitudes = 0;

        for (int num : arr) {
            if (num > 0) {
                productOfSigns *= 1;
                sumOfMagnitudes += num;
            } else if (num < 0) {
                productOfSigns *= -1;
                sumOfMagnitudes += Math.abs(num);
            }
            // If num is 0, do nothing as it doesn't affect the product of signs or sum of magnitudes
        }

        return Optional.of(productOfSigns * sumOfMagnitudes);
    }
}

