class Solution {
    /**
    The Brazilian factorial is defined as:
    brazilian_factorial(n) = n! * (n-1)! * (n-2)! * ... * 1!
    where n > 0

    For example:
    >>> special_factorial(4)
    288

    The function will receive an integer as input and should return the special
    factorial of this integer.
     */
    public long special_factorial(int n) {
        return calculateSpecialFactorial(n);
    }

    private long calculateSpecialFactorial(int n) {
        long result = 1;
        for (int i = n; i > 0; i--) {
            result *= factorial(i);
        }
        return result;
    }

    private long factorial(int num) {
        long fact = 1;
        for (int i = 1; i <= num; i++) {
            fact *= i;
        }
        return fact;
    }
}

