class Solution {
    public List<Integer> minPath(List<List<Integer>> grid, int k) {
        List<Integer> minPath = null;

        for (int i = 0; i < grid.size(); i++) {
            for (int j = 0; j < grid.get(i).size(); j++) {
                List<List<Integer>> paths = new ArrayList<>();
                List<Integer> path = new ArrayList<>();
                Set<String> visited = new HashSet<>();
                path.add(grid.get(i).get(j));
                visited.add(i + "-" + j);
                findPaths(grid, i, j, k, path, visited, paths);

                for (List<Integer> p : paths) {
                    if (minPath == null || comparePaths(p, minPath)) {
                        minPath = new ArrayList<>(p);
                    }
                }
            }
        }

        return minPath;
    }

    private void findPaths(List<List<Integer>> grid, int i, int j, int k, List<Integer> path, Set<String> visited, List<List<Integer>> paths) {
        if (path.size() == k) {
            paths.add(new ArrayList<>(path));
            return;
        }

        int[][] directions = {{0, 1}, {0, -1}, {1, 0}, {-1, 0}};

        for (int[] dir : directions) {
            int newRow = i + dir[0];
            int newCol = j + dir[1];

            if (newRow >= 0 && newRow < grid.size() && newCol >= 0 && newCol < grid.get(newRow).size() && !visited.contains(newRow + "-" + newCol)) {
                path.add(grid.get(newRow).get(newCol));
                visited.add(newRow + "-" + newCol);
                findPaths(grid, newRow, newCol, k, path, visited, paths);
                path.remove(path.size() - 1);
                visited.remove(newRow + "-" + newCol);
            }
        }
    }

    private boolean comparePaths(List<Integer> path1, List<Integer> path2) {
        for (int i = 0; i < path1.size(); i++) {
            if (path1.get(i) < path2.get(i)) {
                return true;
            } else if (path1.get(i) > path2.get(i)) {
                return false;
            }
        }

