class Solution {
    public Optional<Object> compare_one(Object a, Object b) {
        if (a instanceof String && b instanceof String) {
            String strA = (String) a;
            String strB = (String) b;
            if (strA.contains(".") || strA.contains(",")) {
                strA = strA.replace(",", ".");
            }
            if (strB.contains(".") || strB.contains(",")) {
                strB = strB.replace(",", ".");
            }
            Float floatA = Float.parseFloat(strA);
            Float floatB = Float.parseFloat(strB);
            return Optional.of(floatA > floatB ? a : b);
        } else if (a instanceof Float || b instanceof Float) {
            Float floatA = a instanceof Float ? (Float) a : Float.parseFloat((String) a);
            Float floatB = b instanceof Float ? (Float) b : Float.parseFloat((String) b);
            return Optional.of(floatA > floatB ? a : b);
        } else {
            Integer intA = a instanceof Integer ? (Integer) a : Integer.parseInt((String) a);
            Integer intB = b instanceof Integer ? (Integer) b : Integer.parseInt((String) b);
            return Optional.of(intA > intB ? a : b);
        }
    }
}

