    largest_smallest_integers(Arrays.asList(0)) == (Optional.empty(), Optional.empty())
     */
    public List<Optional<Integer>> largest_smallest_integers(List<Integer> lst){
        Optional<Integer> largestNegative = Optional.empty();
        Optional<Integer> smallestPositive = Optional.empty();

        for (Integer num : lst) {
            if (num < 0 && (!largestNegative.isPresent() || num > largestNegative.get())) {
                largestNegative = Optional.of(num);
            } else if (num > 0 && (!smallestPositive.isPresent() || num < smallestPositive.get())) {
                smallestPositive = Optional.of(num);
            }
        }

        List<Optional<Integer>> result = new ArrayList<>();
        result.add(largestNegative);
        result.add(smallestPositive);

        return result;
    }
}

