class Solution {
    private static final List<String> PLANETS = Arrays.asList("Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune");

    public List<String> bf(String planet1, String planet2) {
        if (!PLANETS.contains(planet1) || !PLANETS.contains(planet2)) {
            return new ArrayList<>();
        }

        int orbit1 = PLANETS.indexOf(planet1);
        int orbit2 = PLANETS.indexOf(planet2);

        int start = Math.min(orbit1, orbit2);
        int end = Math.max(orbit1, orbit2);

        List<String> result = new ArrayList<>();
        for (int i = start + 1; i < end; i++) {
            result.add(PLANETS.get(i));
        }

        return result;
    }
}

