class Solution {
    public List<Integer> order_by_points(List<Integer> nums) {
        if (nums == null || nums.isEmpty()) {
            return new ArrayList<>();
        }

        Collections.sort(nums, new Comparator<Integer>() {
            @Override
            public int compare(Integer num1, Integer num2) {
                int sum1 = calculateSumOfDigits(num1);
                int sum2 = calculateSumOfDigits(num2);

                if (sum1 == sum2) {
                    return nums.indexOf(num1) - nums.indexOf(num2);
                }

                return sum1 - sum2;
            }
        });

        return nums;
    }

    private int calculateSumOfDigits(int num) {
        int sum = 0;
        String numStr = String.valueOf(num);

        for (int i = 0; i < numStr.length(); i++) {
            char digit = numStr.charAt(i);
            if (digit == '-') {
                sum -= Character.getNumericValue(numStr.charAt(++i));
            } else {
                sum += Character.getNumericValue(digit);
            }
        }

        return sum;
    }
}

