class Solution {
    public boolean simplify(String x, String n) {
        int[] fraction1 = parseFraction(x);
        int[] fraction2 = parseFraction(n);

        double decimal1 = convertToDecimal(fraction1);
        double decimal2 = convertToDecimal(fraction2);

        double result = multiplyDecimals(decimal1, decimal2);

        return isWholeNumber(result);
    }

    private int[] parseFraction(String fraction) {
        String[] parts = fraction.split("/");
        int numerator = Integer.parseInt(parts[0]);
        int denominator = Integer.parseInt(parts[1]);
        return new int[]{numerator, denominator};
    }

    private double convertToDecimal(int[] fraction) {
        return (double) fraction[0] / fraction[1];
    }

    private double multiplyDecimals(double decimal1, double decimal2) {
        return decimal1 * decimal2;
    }

    private boolean isWholeNumber(double number) {
        return number % 1 == 0;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
