class Solution {
    public boolean isTriangle(int a, int b, int c) {
        return (a + b > c) && (a + c > b) && (b + c > a);
    }

    public boolean isRightAngledTriangle(int a, int b, int c) {
        if (!isTriangle(a, b, c)) {
            return false;
        }

        int[] sides = {a, b, c};
        Arrays.sort(sides);

        return (Math.pow(sides[0], 2) + Math.pow(sides[1], 2) == Math.pow(sides[2], 2));
    }

