class Solution {
    public String find_max(List<String> words) {
        String result = "";
        int maxUnique = 0;

        for (String word : words) {
            int uniqueChars = countUniqueCharacters(word);

            if (uniqueChars > maxUnique || (uniqueChars == maxUnique && word.compareTo(result) < 0)) {
                maxUnique = uniqueChars;
                result = word;
            }
        }

        return result;
    }

    private int countUniqueCharacters(String word) {
        Set<Character> uniqueChars = new HashSet<>();

        for (char c : word.toCharArray()) {
            uniqueChars.add(c);
        }

        return uniqueChars.size();
    }
}

