class Solution {
    public List<Integer> make_a_pile(int n) {
        List<Integer> stones = new ArrayList<>();
        stones.add(n);

        while (n > 1) {
            if (n % 2 == 0) {
                n += 1;
            } else {
                n += 2;
            }
            stones.add(n);
        }

        return stones;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.make_a_pile(3).equals(Arrays.asList(3, 5, 7)),
                s.make_a_pile(4).equals(Arrays.asList(4, 6, 8, 10)),
                s.make_a_pile(5).equals(Arrays.asList(5, 7, 9, 11, 13)),
                s.make_a_pile(6).equals(Arrays.asList(6, 8, 10, 12, 14, 16)),
                s.make_a_pile(8).equals(Arrays.asList(8, 10, 12, 14, 16, 18, 20, 22))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
